import './MainSection.css'
import BabyProducts from './Categories/BabyProducts';
import Fashion from './Categories/Fashion';
import HealthBeauty from './Categories/HealthBeauty';
import Supermarket from './Categories/Supermarket'
import CatGroup from './Categories/PhoneTablets'

import { Col, Row } from 'react-bootstrap';
import MidSlider from './MiddleSlider/MidSlider';
import UpperSide from './Right part/UpperSide';
import LowerSide from './Right part/LowerSide';


const MainSection = () => {
    return (
        <div className='main-sec'>
            <Row>
                <Col className='categories' lg='2'>
                    <CatGroup/>
                </Col>
                <Col className='mid' lg='7'>
                    <MidSlider />
                </Col>
                <Col className='right-side' lg='3'>
                    <UpperSide />
                    <LowerSide />
                </Col>
            </Row>
        </div>
    )
}
export default MainSection;
